import React from "react";
import styled from "styled-components";
import "./App.css";

const TextArea = styled.textarea`
  rows:"4"
  cols:50
  width: 250px;
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19);
  text-align: center;
`;

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Getting started.</p>
        <TextArea />
      </header>
    </div>
  );
}

export default App;
